		var _this = this; 
		
		_this.on("click", function (e) {
				if (e.target.name === "unmute")
				{
				sound.muted = false;
					_this.mute.visible = true;
					_this.unmute.visible = false;
				} else if (e.target.name === "mute") {
				sound.muted = true;
					_this.mute.visible = false;
					_this.unmute.visible = true;
				}	
			});
			
